import HomePage from "./routes/Home";
import GamePage from "./routes/Game";
import { BrowserRouter, Route, Switch } from "react-router-dom";

const App = () => {
  <BrowserRouter>
    <Switch>
      <Route path="/home" component={HomePage} />
    </Switch>
    ;
  </BrowserRouter>;
};

export default App;
